import React from "react";

import { Link } from "react-router-dom";

function Movie(props) {
  const {
    id,
    title,
    rating,
    description_intro,
    language,
    medium_cover_image,
    genres,
  } = props;
  return (
    <div>
      <Link to={`/${id}`}>{title}</Link>
    </div>
  );
}

export default Movie;
